sub water_vapor_pressure($ ) {
   my ($tempk) = @_;
   my $retvalu;
   my $tempc;
   if ($tempk <= 16.1 or WATER_CRITICAL <= $tempk) {
      $retvalu = 0.0;
   } else {
      $tempc = Kw::k2tempc($tempk);
      if (0.0 <= $tempc) {
         $retvalu = 611.21 * exp((18.678 - $tempc / 234.5) *
               ($tempc / (257.14 + $tempc)));
      } else {
         $retvalu = 611.15 * exp((23.036 - $tempc / 333.7) *
               ($tempc / (279.82 + $tempc)));
      }
   }
   return ($retvalu);
}
sub water_vaporization($ ) {
   my ($tempk) = @_;
   my $retvalu;
   if (WATER_CRITICAL <= $tempk) {
      $retvalu = 0.0;
   } else {
      $retvalu = Kw::pow((WATER_CRITICAL - $tempk) /
            (WATER_CRITICAL - 373.15), 0.37) *
            WATER_VAPORIZATION_JPMOLE;
   }
   return ($retvalu);
}
sub water_boiling($ ) {
   my ($pressure_pa) = @_;
   my $retvalu;
   if ($pressure_pa <= 0.0) {
      $retvalu = 0.0;
   } else {
      $retvalu = 1.0 / (1.0 / 373.15 - log($pressure_pa /
            Kw::ATM) * Kw::GAS / WATER_VAPORIZATION_JPMOLE);
   }
   return ($retvalu);
}
